#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` varchar(255) NOT NULL,
  `externalid` varchar(255) DEFAULT NULL,
  `salutation` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `initials` varchar(255) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `supervisor` varchar(255) DEFAULT NULL,
  `comments` text,
  `email` varchar(255) DEFAULT NULL,
  `document` varchar(255) DEFAULT NULL,
  `dateofbirth` int(11) DEFAULT NULL,
  `dateofhire` int(11) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `mobilephone` varchar(255) DEFAULT NULL,
  `defaultaddress` text,
  `subsidiary` varchar(255) DEFAULT NULL,
  `immediateapprover` varchar(255) DEFAULT NULL,
  `topapprover` varchar(255) DEFAULT NULL,
  `emailprefix` varchar(255) DEFAULT NULL,
  `commercialspecialist` varchar(255) NOT NULL DEFAULT 'F',
  `salesrepresentative` varchar(255) NOT NULL DEFAULT 'F',
  `supportrepresentative` varchar(255) NOT NULL DEFAULT 'F',
  `eligibleforcommission` varchar(255) NOT NULL DEFAULT 'F',
  `contractdate` int(11) DEFAULT NULL,
  `hash` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `login_attempts` int(11) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `giveaccess` varchar(1) NOT NULL DEFAULT 'F',
  `sendemail` varchar(1) NOT NULL DEFAULT 'F',
  `isinactive` varchar(255) NOT NULL DEFAULT 'T',
  `roles` text,
  `defaulttheme` varchar(255) DEFAULT 'light',
  `has_valid` varchar(1) DEFAULT 'F',
  `confirmed` varchar(255) NOT NULL DEFAULT 'F',
  `ip` varchar(255) DEFAULT NULL,
  `agent` varchar(255) DEFAULT NULL,
  `platform` varchar(255) DEFAULT NULL,
  `referer` varchar(255) DEFAULT NULL,
  `created` int(11) DEFAULT NULL,
  `updated` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



